import React, { Component } from 'react'

export default class TodoForm extends Component {
  render() {
    return (    
        
        <div className="container">
            <h3 className='text-center'>TodoList</h3>
            <div className="row">
                <div className="col-md-3">
                    <form action="">
                        <input type="text" name="" id="" />
                    </form>
                </div>
            </div>
            
        </div>
    )
  }
}
